import React, { useState } from "react";
import Footer from "../components/footer";
import { createGlobalStyle } from "styled-components";
import { connect } from "react-redux";
import PropTypes from "prop-types";
const GlobalStyles = createGlobalStyle`
  header#myHeader.navbar.sticky.white {
    background: #403f83;
    border-bottom: solid 1px #403f83;
  }
  header#myHeader.navbar .search #quick_search{
    color: #fff;
    background: rgba(255, 255, 255, .1);
  }
  header#myHeader.navbar.white .btn, .navbar.white a, .navbar.sticky.white a{
    color: #fff;
  }
  header#myHeader .dropdown-toggle::after{
    color: rgba(255, 255, 255, .5);
  }
  header#myHeader .logo .d-block{
    display: none !important;
  }
  header#myHeader .logo .d-none{
    display: block !important;
  }
  @media only screen and (max-width: 1199px) {
    .navbar{
      background: #403f83;
    }
    .navbar .menu-line, .navbar .menu-line1, .navbar .menu-line2{
      background: #fff;
    }
    .item-dropdown .dropdown a{
      color: #fff !important;
    }
  }
`;
const initialState = {
  username: "",
  password: "",
};
const Login = ({ setAlert, auth: { isLogged, isAdmin } }) => {
  const [user, setUser] = useState(initialState);
  const dispatch = useDispatch();

  const { username, password } = user;

  const handleChangeInput = (e) => {
    const { name, value } = e.target;
    setUser({ ...user, [name]: value });
  };
  const handleSubmit = async (e) => {
    e.preventDefault();
    if (isEmpty(username) || isEmpty(password)) {
      setAlert("Please fill in all fields.", "danger");

      return setUser({
        ...user,
      });
    }

    try {
      const res = await axios.post("/user/login", { email, password });
      setAlert(res.data.msg, "success");
      setUser({ ...user });

      localStorage.setItem("firstLogin", true);

      dispatch(dispatchLogin());
      // navigate("/dashboard");
      // return <Navigate to="/dashboard" />
    } catch (err) {
      err?.response?.data?.msg && setAlert(err?.response?.data?.msg, "danger");
      setUser({ ...user });
    }
  };
  return (
    <div>
      <GlobalStyles />

      <section
        className="jumbotron breadcumb no-bg"
        style={{ backgroundImage: `url(${"./img/background/subheader.jpg"})` }}
      >
        <div className="mainbreadcumb">
          <div className="container">
            <div className="row align-items-center">
              <div
                className="col-lg-5 text-light wow fadeInRight"
                data-wow-delay=".5s"
              >
                <div className="spacer-10"></div>
                <h1>Create, sell or collect digital items.</h1>
                <p className="lead">
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed
                  do eiusmod tempor incididunt ut labore et dolore magna aliqua
                  ut enim.
                </p>
              </div>
              <div
                className="col-lg-4 offset-lg-2 wow fadeIn"
                data-wow-delay=".5s"
              >
                <div className="box-login">
                  <h3 className="mb10">Sign In</h3>
                  <p>
                    Login using an existing account or create a new account{" "}
                    <span>here</span>.
                  </p>
                  <form
                    name="contactForm"
                    id="contact_form"
                    className="form-border"
                    action="#"
                  >
                    <div className="field-set">
                      <input
                        type="text"
                        name="email"
                        id="email"
                        className="form-control"
                        placeholder="username"
                      />
                    </div>

                    <div className="field-set">
                      <input
                        type="password"
                        name="password"
                        id="password"
                        className="form-control"
                        placeholder="password"
                      />
                    </div>

                    <div className="field-set">
                      <input
                        type="submit"
                        id="send_message"
                        value="Submit"
                        className="btn btn-main btn-fullwidth color-2"
                      />
                    </div>

                    <div className="clearfix"></div>

                    <div className="spacer-single"></div>
                    <ul className="list s3">
                      <li>Login with:</li>
                      <li>
                        <span>Facebook</span>
                      </li>
                      <li>
                        <span>Google</span>
                      </li>
                    </ul>
                  </form>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      <Footer />
    </div>
  );
};
export default Login;
